import React from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import {withStyles} from "@material-ui/core/styles";

const styles = theme => ({
    paper: {
        height: 400,
        width: '100%',
        marginTop: 0,
        overflow: 'auto'
    },
});

const createTableComponent = (props) => {
    const tableHeaders = props.tableHeaders || [];
    const tableData = props.tableData || [];

    return (<Table style={{width: props.width - 10, margin: 'auto', borderRadios: 0, padding: 50}} aria-label="simple table">
        <TableHead>
            <TableRow key={0}>
                {tableHeaders.map((header, cellIdx) => {
                    return <TableCell key={cellIdx}>{header}</TableCell>;
                })}
            </TableRow>
        </TableHead>
        <TableBody>
            {tableData.map((data, rowIdx) => {
                return <TableRow key={rowIdx}> {Object.keys(data).map((key, cellIdx) => {
                    return <TableCell key={cellIdx}>{data[key]}</TableCell>;
                })}
                </TableRow>
            })}
        </TableBody>
    </Table>);
}

function BasicTable(props) {
    const { classes , theme} = props;
    const tableComponent = createTableComponent(props);
    return (
        <TableContainer component={Paper} className={classes.paper} style={{'overflowY': 'scroll',}}>
            {tableComponent}
        </TableContainer>
    );
}
export default withStyles(styles, { withTheme: true })(BasicTable);
